import React from "react";
import styles from "../styles/DataSeparator.module.css";

function DataSeparator(props) {
    const { data, styleText, styleContainer, lineColor } = props;
    const styles={
        ...styleContainer,
        '--line-color':lineColor
    };
    return (
        <div className={styles.separator} style={styleContainer}>
            <span className={styles.text} style={styleText}>
                {data}
            </span>
        </div>
    );
}

export default React.memo(DataSeparator);
